import React, { useState } from "react";
import "./App.scss";
import Navbar from "./component/navbar";

function App() {
  const [start, setStart] = useState(false);

  const showMain = () => {
    if (start === true) {
      return <Navbar></Navbar>;
    } else {
      return <button className="app__start">Start </button>;
    }
  };

  return (
    <div className="App">
      {start ? (
        <Navbar></Navbar>
      ) : (
        <button className="app__start">Start </button>
      )}

      <Navbar></Navbar>
    </div>
  );
}

export default App;
